import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import React from "react";

const Products=(props)=>{
    return (
        <Box sx={{ width: '100%' }}>
        <Grid2
		container
		direction="row"
		>
      </Grid2>
      </Box>
    )
}

export default Products;
